// Footer.jsx
import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCcVisa, faCcMastercard, faPaypal, faApplePay } from '@fortawesome/free-brands-svg-icons';

import './Footer.css'; // We'll add the styles later

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-container">
        {/* Left Section: Be the First to Know */}
        <div className="footer-section subscribe-section">
          <h4>BE THE FIRST TO KNOW</h4>
          <p>Sign up for updates from mett√§ muse.</p>
          <input type="email" placeholder="Enter your e-mail" />
          <button>SUBSCRIBE</button>
        </div>

        {/* Center Section: Contact and Payment Icons */}
        <div className="footer-section contact-section">
          <h4>CONTACT US</h4>
          <p>+44 223 133 5380</p>
          <p>customer@mettamuse.com</p>
          <h4>CURRENCY</h4>
          <p>$ USD</p>

          {/* Payment Icons */}
          <div className="payment-icons">
            <FontAwesomeIcon icon={faCcVisa} className="payment-icon" />
            <FontAwesomeIcon icon={faCcMastercard} className="payment-icon" />
            <FontAwesomeIcon icon={faPaypal} className="payment-icon" />
            <FontAwesomeIcon icon={faApplePay} className="payment-icon" />
          </div>
        </div>

        {/* Right Section: Links */}
        <div className="footer-section links-section">
          <h4>QUICK LINKS</h4>
          <ul>
            <li>Orders & Shipping</li>
            <li>Join/Login as a Seller</li>
            <li>Payment & Pricing</li>
            <li>Return & Refunds</li>
            <li>FAQs</li>
            <li>Privacy Policy</li>
            <li>Terms & Conditions</li>
          </ul>
        </div>
      </div>

      {/* Bottom Bar */}
      <div className="footer-bottom">
        <p>&copy; 2023 mettamuse. All rights reserved.</p>
      </div>
    </footer>
  );
};

export default Footer;
